package main

import "testing"

func TestIsPalindrome(t *testing.T) {
	var cases = []struct {
		s string
		e bool
	}{
		{"a", true},
		{"aa", true},
		{"ab", false},
		{"aba", true},
	}
	for _, c := range cases {
		g := isPalindrome(c.s)
		if g != c.e {
			t.Errorf("%q, Expected: %t, Got: %t", c.s, c.e, g)
		}
	}
}

func TestMakePalindrome1(t *testing.T) {
	testMakePalindrome(t, makePalindrome1)
}

func TestMakePalindrome2(t *testing.T) {
	testMakePalindrome(t, makePalindrome2)
}

func testMakePalindrome(t *testing.T, f func(string) int) {
	var cases = []struct {
		s string
		e int
	}{
		{"ab", 0},
		{"a", -1},
		{"abcbae", 5},
	}
	for _, c := range cases {
		g := f(c.s)
		if g != c.e {
			t.Errorf("%q, Expected: %d, Got: %d", c.s, c.e, g)
		}
	}
}

func BenchmarkMakePalindrome1(b *testing.B) {
	benchmarkMakePalindrome(b, makePalindrome1)
}
func BenchmarkMakePalindrome2(b *testing.B) {
	benchmarkMakePalindrome(b, makePalindrome2)
}

func benchmarkMakePalindrome(b *testing.B, f func(string) int) {
	s := ` `
	for i := 0; i < b.N; i++ {
		f(s)
	}
}
